import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Find the "Your Profile" link (multiple exist, but we want the one that navigates to Jun's Profile)
    // We'll click the first visible "Your Profile" link
    const profileLinks = await page.$$('a');
    let junProfileLink = null;
    for (const link of profileLinks) {
      const text = await link.textContent();
      if (text && text.trim() === 'Your Profile') {
        const isVisible = await link.isVisible();
        if (isVisible) {
          junProfileLink = link;
          break;
        }
      }
    }

    if (!junProfileLink) {
      throw new Error('Could not find "Your Profile" link');
    }

    // Wait for the link to be attached and visible
    await junProfileLink.waitForElementState('visible', { timeout: 5000 });

    // Click the "Your Profile" link
    await junProfileLink.click();

    // Wait for Jun's profile page to load (look for .profile-page or Jun's name)
    await page.waitForSelector('.profile-page', { timeout: 5000 });

    // Take a screenshot after navigation
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_jun_profile.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_jun_profile.png'));

    // Extract Jun's profile name and username
    const fullName = await page.$eval('.profile-info h2', el => el.textContent.trim());
    const username = await page.$eval('.profile-info .username', el => el.textContent.trim());

    return {
      success: true,
      action: "Navigated to Jun's Profile page and verified profile details",
      extractedData: {
        fullName,
        username
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
